import React from 'react';
import './App.css';
import Navbar from './components/Navbar'
import {BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div>
        <Navbar />
        <header>
          <p>Welcome Screen</p>
        </header>
      </div>
    </Router>
  );
}

export default App;
